  false,\n\t\"url\": null,\n\t\"notes\": \"The National Land Cover Database 2001 land
  cover layer for Minnesota (mapping zones 31-51) was produced through a cooperative
  project conducted by the Multi-Resolution Land Characteristics (MRLC) Consortium.
  One of the primary goals of the project is to generate a current, consistent, seamless,
  and accurate National Land cover Database (NLCD) circa 2001 for the United States
  at medium spatial resolution. This landcover map and all documents pertaining to
  it are considered \"provisional\" until a formal accuracy assessment can be conducted.
  For a detailed definition and discussion on MRLC and the NLCD 2001 products, refer
  to Homer et al. (2004).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
